import {makeStyles} from "@material-ui/core"
import { withFormik, Field, Form } from 'formik'

const useStyles = makeStyles(() => ({
    formStyle: {
        position: "absolute",
        top: 100,
        left: 1500,
    },
    fieldStyle: {
        backgroundColor: "#252525",
        color: "white",
        borderRadius: 6,
        height: 30,
    }
}))

function TemplateForms(values, touched, isSubmitting){
    const {formStyle, fieldStyle} = useStyles()
    return (
        <Form className={formStyle}>
            <Field type="text" name="variables" placeholder="Variables" className={fieldStyle}/>
            <Button disabled={isSubmitting}>Run</Button>
        </Form>
    )
}

const Forms = withFormik({
    mapPropsToValues(){
        return {
            variables: '',
            constraints: ''
        }
    },
    handleSubmit(values){
        console.log(values)
    }
})(TemplateForms)

export default Forms
